import React from 'react';
import NavBar from './NavBar';
import Messages from './Messages';

class Home extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            messages : [
                {
                    text: "Welcome Agent. You are now a part of an elite academy of spies dedicated to understanding computers. ",
                    member: {
                        color: "black",
                        username: "Mission Control"
                    }
                },
                {
                    text: "Your first mission is to find the jewel on the next page. You may have to click around to find it.",
                    member: {
                        color: "black",
                        username: "Mission Control"
                    }
                }
            ],
            member: {
                username: 'spy',
                color: 'blue'
            }
        };
    }
    render() {
        return (
            <div>
                <Messages
                    messages={this.state.messages}
                    currentMember={this.state.member}
                />
                <NavBar />
            </div>
        );
    }
}

export default Home;
